CowboyRule_winning_hands_desc:
Players can bet any of five categories of Winning Hands;
a) High card, One pair;
b) Two Pair;
c) Trips, Straight, Flush;
d) Full House;
e) Quads, Straight Flush, Royal Flush
Player reward is based on each correct bet's odds.

